const matrixCanvas = document.createElement("canvas");
matrixCanvas.classList.add("matrix-canvas");
const matrixContext = matrixCanvas.getContext("2d");
matrixCanvas.height = window.innerHeight;
matrixCanvas.width = window.innerWidth;
document.querySelector("body").appendChild(matrixCanvas);

const image = new Image();
image.src =
  "data:image/jpeg;base64,";

image.addEventListener("load", function () {
  const canvas = document.querySelector("#canvas");
  const context = canvas.getContext("2d");
  canvas.width = 600;
  canvas.height = 600;

  context.drawImage(image, 0, 0, canvas.width, canvas.height);
  const pixels = context.getImageData(0, 0, canvas.width, canvas.height);
  context.clearRect(0, 0, canvas.width, canvas.height);

  let particleArray = [];
  const numberOfParticles = 5000;

  let mappedImage = [];
  for (let y = 0; y < canvas.height; y++) {
    let row = [];
    for (let x = 0; x < canvas.width; x++) {
      const red = pixels.data[y * 4 * pixels.width + x * 4];
      const green = pixels.data[y * 4 * pixels.width + (x * 4 + 1)];
      const blue = pixels.data[y * 4 * pixels.width + (x * 4 + 2)];
      const brightness = calculareRelativeBrightness(red, green, blue);
      const cell = [
        (cellBrigthness = brightness),
        (cellColor = `rgb(${red},${green},${blue})`),
      ];
      row.push(cell);
    }
    mappedImage.push(row);
  }
  function calculareRelativeBrightness(red, green, blue) {
    let square =
      Math.sqrt(
        red * red * 0.299 + green * green * 0.587 + blue * blue * 0.144
      ) / 100;
    return square;
  }
  let asd = 0;
  class Particle {
    constructor() {
      this.x = Math.random() * canvas.width;
      this.y = Math.random() * canvas.height;
      this.speed = 0;
      this.velocity = Math.random() * 0.5;
      this.size = Math.random() * 2.5 + 1.0;
      this.positionY = Math.floor(this.y);
      this.positionX = Math.floor(this.x);
      this.angle = 0;
      this.random = Math.random();
    }
    update() {
      this.positionY = Math.floor(this.y);
      this.positionX = Math.floor(this.x);
      if (
        mappedImage[this.positionY] &&
        mappedImage[this.positionY][this.positionX]
      ) {
        this.speed = mappedImage[this.positionY][this.positionX][0];
      }
      let movement = 2.6 - this.speed + this.velocity;
      this.angle += this.speed / 20;
      this.size = 0.8 + this.speed * 0.9;

      this.y += movement + Math.cos(this.angle) * 1;
      this.x += movement + Math.sin(this.angle) * 1;
      if (this.y >= canvas.height) {
        this.y = 0;
        this.x = Math.random() * canvas.width;
      }
      if (this.x >= canvas.width) {
        this.x = 0;
        this.y = Math.random() * canvas.height;
      }
    }
    draw() {
      context.beginPath();
      if (
        mappedImage[this.positionY] &&
        mappedImage[this.positionY][this.positionX]
      ) {
        context.fillStyle = mappedImage[this.positionY][this.positionX][1];
      }
      context.arc(this.x, this.y, this.size, 0, Math.PI * 2);
      context.fill();
    }
  }
  function init() {
    for (let i = 0; i < numberOfParticles; i++) {
      particleArray.push(new Particle());
    }
  }
  init();
  function animate() {
    context.globalAlpha = 0.05;
    context.fillStyle = "rgb(0,0,0)";
    context.fillRect(0, 0, canvas.width, canvas.height);
    context.globalAlpha = 0.2;

    for (let i = 0; i < particleArray.length; i++) {
      particleArray[i].update();
      // context.globalAlpha = particleArray[i].speed * 0.5;
      context.globalAlpha = 1;
      particleArray[i].draw();
    }
    requestAnimationFrame(animate);
  }
  animate();
});

// matrix stuff

let gradient = matrixContext.createLinearGradient(
  matrixCanvas.width / 2,
  0,
  matrixCanvas.width / 2,
  matrixCanvas.height
);
gradient.addColorStop(0, "#0AFF0A");
gradient.addColorStop(0.1, "#38FE08");
gradient.addColorStop(0.2, "#67FD07");
gradient.addColorStop(0.3, "#95FC05");
gradient.addColorStop(0.4, "#C4FB04");
gradient.addColorStop(0.5, "#F2FA02");
gradient.addColorStop(0.6, "#F4C802");
gradient.addColorStop(0.7, "#F59702");
gradient.addColorStop(0.8, "#F76502");
gradient.addColorStop(0.9, "#F83402");
gradient.addColorStop(1, "#FA0202");

class Character {
  constructor(x, y, fontSize, canvasHeight) {
    this.characters =
      "アァカサタナハマヤャラワガザダバパイィキシチニヒミリヰギジヂビピウゥクスツヌフムユュルグズブヅプエェケセテネヘメレヱゲゼデベペオォコソトノホモヨョロヲゴゾドボポヴッン0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZ";
    this.x = x;
    this.y = y;
    this.fontSize = fontSize;
    this.text = "";
    this.canvasHeight = canvasHeight;
  }
  draw() {
    this.text = this.characters.charAt(
      Math.floor(Math.random() * this.characters.length)
    );
    matrixContext.fillText(
      this.text,
      this.x * this.fontSize,
      this.y * this.fontSize
    );
    if (this.y * this.fontSize > this.canvasHeight && Math.random() > 0.999) {
      this.y = 0;
    } else {
      this.y += 1;
    }
  }
}

class Effect {
  constructor(canvasHeight, canvasWidth) {
    this.canvasHeight = canvasHeight;
    this.canvasWidth = canvasWidth;
    this.fontSize = 20;
    this.column = this.canvasWidth / this.fontSize;
    this.character = [];
    this.#initialize();
  }
  #initialize() {
    for (let i = 0; i < this.column; i++) {
      this.character[i] = new Character(i, 0, this.fontSize, this.canvasHeight);
    }
  }
  resize(height, width) {
    this.canvasHeight = height;
    this.canvasWidth = width;
    this.column = this.canvasWidth / this.fontSize;
    this.character = [];
    this.#initialize();
  }
}

const matrixEffect = new Effect(matrixCanvas.height, matrixCanvas.width);
let lastTime = 0;
const fps = 30;
const nextFrame = 1000 / fps;
let timer = 0;

function matrixAnimate(timeStamp) {
  const deltaTime = timeStamp - lastTime;
  lastTime = timeStamp;
  if (timer > nextFrame) {
    matrixContext.fillStyle = "rgba(0,0,0,0.1)";
    matrixContext.textAlign = "center";
    matrixContext.fillRect(0, 0, matrixCanvas.width, matrixCanvas.height);
    matrixContext.fillStyle = gradient; // "#0aff0a";
    matrixContext.font = matrixEffect.fontSize + "px monospace";
    matrixEffect.character.forEach((char) => char.draw(matrixContext));
    timer = 0;
  } else {
    timer += deltaTime;
  }
  requestAnimationFrame(matrixAnimate);
}
matrixAnimate(0);

